import{_ as e,a,b as r}from"./chunks/voxl-2-connectors.ClczDOo-.js";import{_ as d,c as o,a8 as l,o as i}from"./chunks/framework.BDnHobkS.js";const S=JSON.parse('{"title":"ModalAI VOXL 2","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/modalai_voxl_2.md","filePath":"uk/flight_controller/modalai_voxl_2.md"}'),n={name:"uk/flight_controller/modalai_voxl_2.md"};function h(s,t,c,p,m,u){return i(),o("div",null,t[0]||(t[0]=[l('<h1 id="modalai-voxl-2" tabindex="-1">ModalAI VOXL 2 <a class="header-anchor" href="#modalai-voxl-2" aria-label="Permalink to &quot;ModalAI VOXL 2&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://forum.modalai.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The ModalAI <a href="https://modalai.com/voxl-2" target="_blank" rel="noreferrer">VOXL 2</a> (<a href="https://docs.modalai.com/voxl2-datasheets/" target="_blank" rel="noreferrer">Datasheet</a>) is ModalAI’s next-gen autonomous computing platform built around the Qualcomm QRB5165 processor. VOXL 2 має 8 ядер, вбудований PX4, сім одночасних камер, бортовий ШІ до 15+ TOPS та підтримку 5G зв&#39;язку. З вагою 16 грамів, VOXL 2 - це майбутнє повністю автономних та підключених дронів!</p><p><img src="'+e+'" alt="VOXL-2"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><h3 id="система" tabindex="-1">Система <a class="header-anchor" href="#система" aria-label="Permalink to &quot;Система&quot;">​</a></h3><table tabindex="0"><thead><tr><th>Характеристика</th><th>VOXL 2</th></tr></thead><tbody><tr><td>CPU</td><td>QRB5165 <br>8 ядер до 3.091ГГц <br>8ГБ LPDDR5<br>128ГБ Flash</td></tr><tr><td>OS</td><td>Ubuntu 18.04 - Linux Kernel v4.19</td></tr><tr><td>GPU</td><td>Графічний процесор Adreno 650 - 1024 ALU</td></tr><tr><td>NPU</td><td>15 TOPS</td></tr><tr><td>Налаштування контролера польоту</td><td>Так (датчики DSP, PX4)</td></tr><tr><td>Вбудований WiFi</td><td>Ні</td></tr><tr><td>Додаткове підключення</td><td>WiFi, 5G, 4G/LTE, Microhard</td></tr><tr><td>Кодування відео</td><td>8K30 h.264/h.265 108MP still images</td></tr><tr><td>Датчики комп&#39;ютерного зору</td><td>QTY 6 4-lane CSI, QTY4 CCI (e.g. 2 stereo pair, hires, трекінг)</td></tr><tr><td>Датчик трекінгу</td><td>Так</td></tr><tr><td>Розміри</td><td>70мм х 36мм</td></tr><tr><td>Вага</td><td>16г</td></tr><tr><td>VOXL SDK: навігація без GPS, SLAM, уникання перешкод, розпізнавання об&#39;єктів</td><td>Так</td></tr><tr><td>ROS</td><td>ROS 1 &amp; 2</td></tr><tr><td>QGroundControl</td><td>Так</td></tr><tr><td>ATAK</td><td>Так</td></tr><tr><td>Сумісний з NDAA ’20 Section 848</td><td>Так, зібрано в США</td></tr><tr><td>PMD TOF</td><td>Так (SDK 1.0 та новіше)</td></tr><tr><td>FLIR Boson</td><td>USB</td></tr><tr><td>FLIR Lepton</td><td>USB, SPI</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>More detailed hardware documentation can be found <a href="https://docs.modalai.com/voxl-flight-datasheet/" target="_blank" rel="noreferrer">here</a>.</p></div><h2 id="розміри" tabindex="-1">Розміри <a class="header-anchor" href="#розміри" aria-label="Permalink to &quot;Розміри&quot;">​</a></h2><h3 id="_2d-розмір" tabindex="-1">2D розмір <a class="header-anchor" href="#_2d-розмір" aria-label="Permalink to &quot;2D розмір&quot;">​</a></h3><p><img src="'+a+'" alt="VOXL2Dimensions"></p><h3 id="_3d-розміри" tabindex="-1">3D розміри <a class="header-anchor" href="#_3d-розміри" aria-label="Permalink to &quot;3D розміри&quot;">​</a></h3><p><a href="https://storage.googleapis.com/modalai_public/modal_drawings/M0054_VOXL2_PVT_SIP_REVA.step" target="_blank" rel="noreferrer">3D STEP File</a></p><h2 id="сумісність-прошивки-px4" tabindex="-1">Сумісність прошивки PX4 <a class="header-anchor" href="#сумісність-прошивки-px4" aria-label="Permalink to &quot;Сумісність прошивки PX4&quot;">​</a></h2><h3 id="гілка-voxl-dev" tabindex="-1">гілка voxl-dev <a class="header-anchor" href="#гілка-voxl-dev" aria-label="Permalink to &quot;гілка voxl-dev&quot;">​</a></h3><p>ModalAI is actively maintaining a <a href="https://github.com/modalai/px4-firmware/tree/voxl-dev" target="_blank" rel="noreferrer">branched PX4 version</a> that can be used.</p><p>As VOXL 2 runs Ubuntu, the production releases of PX4 for VOXL 2 are distributed through <a href="https://docs.modalai.com/configure-pkg-manager/" target="_blank" rel="noreferrer">apt package management</a> and the <a href="https://docs.modalai.com/voxl-sdk/" target="_blank" rel="noreferrer">VOXL SDK</a>.</p><p>More information about the firmware can be found <a href="https://docs.modalai.com/voxl2-px4-developer-guide/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="основна-гілка" tabindex="-1">основна гілка <a class="header-anchor" href="#основна-гілка" aria-label="Permalink to &quot;основна гілка&quot;">​</a></h3><p>PX4 mainline supports VOXL 2 (board documentation <a href="https://github.com/PX4/PX4-Autopilot/tree/main/boards/modalai/voxl2" target="_blank" rel="noreferrer">here</a>).</p><h2 id="qgroundcontrol-підтримка" tabindex="-1">QGroundControl Підтримка <a class="header-anchor" href="#qgroundcontrol-підтримка" aria-label="Permalink to &quot;QGroundControl Підтримка&quot;">​</a></h2><p>Ця плата підтримується QGroundControl 4.0 та пізнішими версіями.</p><h2 id="доступність" tabindex="-1">Доступність <a class="header-anchor" href="#доступність" aria-label="Permalink to &quot;Доступність&quot;">​</a></h2><ul><li><a href="https://www.modalai.com/products/px4-autonomy-developer-kit" target="_blank" rel="noreferrer">PX4 Autonomy Developer Kit</a></li><li><a href="https://www.modalai.com/products/starling-2" target="_blank" rel="noreferrer">Starling 2</a></li><li><a href="https://www.modalai.com/products/starling-2-max" target="_blank" rel="noreferrer">Starling 2 MAX</a></li><li><a href="https://www.modalai.com/pages/sentinel" target="_blank" rel="noreferrer">Sentinel Development Drone powered by VOXL 2</a><ul><li><a href="https://www.youtube.com/watch?v=hMhQgWPLGXo" target="_blank" rel="noreferrer">Demo Video</a></li></ul></li><li><a href="https://www.modalai.com/collections/ready-to-mount/products/voxl-2-flight-deck" target="_blank" rel="noreferrer">VOXL 2 Flight Deck, ready to mount, tune and fly</a></li><li><a href="https://www.modalai.com/products/voxl-2" target="_blank" rel="noreferrer">VOXL 2 Development Kits</a><ul><li><a href="https://www.youtube.com/watch?v=aVHBWbwp488" target="_blank" rel="noreferrer">Demo Video</a></li></ul></li></ul><h2 id="швидкии-старт" tabindex="-1">Швидкий Старт <a class="header-anchor" href="#швидкии-старт" aria-label="Permalink to &quot;Швидкий Старт&quot;">​</a></h2><p>Quickstarts from the vendor are located <a href="https://docs.modalai.com/voxl2-quickstarts/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="voxl-sdk" tabindex="-1">VOXL SDK <a class="header-anchor" href="#voxl-sdk" aria-label="Permalink to &quot;VOXL SDK&quot;">​</a></h3><p>VOXL SDK (Software Development Kit) consists of the open source <a href="https://docs.modalai.com/voxl-px4/" target="_blank" rel="noreferrer">voxl-px4</a>, <a href="https://docs.modalai.com/core-libs/" target="_blank" rel="noreferrer">core libraries</a>, <a href="https://docs.modalai.com/mpa-services/" target="_blank" rel="noreferrer">services</a>, <a href="https://docs.modalai.com/inspect-tools/" target="_blank" rel="noreferrer">tools</a>, <a href="https://docs.modalai.com/sdk-utilities/" target="_blank" rel="noreferrer">utilities</a>, and <a href="https://docs.modalai.com/build-environments/" target="_blank" rel="noreferrer">build environments</a> that ModalAI provide to accelerate the use and development of VOXL compute boards and accessories.</p><p>VOXL SDK працює на VOXL, VOXL 2 та RB5 Flight!</p><p>Вихідний код для проєктів у межах VOXL SDK можна знайти на <a href="https://gitlab.com/voxl-public" target="_blank" rel="noreferrer">https://gitlab.com/voxl-public</a>, поруч з інструкціями зі збірки.</p><h3 id="з-єднання" tabindex="-1">З’єднання <a class="header-anchor" href="#з-єднання" aria-label="Permalink to &quot;З’єднання&quot;">​</a></h3><p>Detailed information about the pinouts can be found <a href="https://docs.modalai.com/voxl2-connectors/" target="_blank" rel="noreferrer">here</a> along with a <a href="https://www.youtube.com/watch?v=xmqI3msjqdo" target="_blank" rel="noreferrer">video overview here</a></p><p><img src="'+r+'" alt="VOXLConnectors"></p><p>Усі односторонні сигнали на роз&#39;ємах B2B J3, J5, J6, J7 та J8 є 1,8В CMOS, якщо явно не вказано інше. All single ended signals on cable-to-board connectors J10, J18, &amp; J19 are 3.3V CMOS unless explicitly noted.</p><table tabindex="0"><thead><tr><th>З’єднання</th><th>Опис</th><th>MPN (Сторона плати)</th><th>З&#39;єднання MPN (сторона плати/кабелю)</th><th>Тип</th><th>Загальний опис функцій сигналізації</th></tr></thead><tbody><tr><td>J2</td><td>Охолодження</td><td>SM02B-SRSS-TB(LF)(SN)</td><td>SHR-02V-S</td><td>Cable Header, 2-pin R/A</td><td>5V DC для вентилятора + регулювання FAN-повернення (GND)</td></tr><tr><td>J3</td><td>Legacy B2B</td><td>QSH-030-01-L-D-K-TR</td><td>QTH-030-01-L-D-A-K-TR</td><td>B2B накопичувач, 60-pin</td><td>5V/3.8V/3.3V/1.8V живлення для плати, JTAG і Debug Signals QUP expansion, GPIOs, USB3.1 Gen 2 (USB1)</td></tr><tr><td>J4</td><td>Максимальна потужність</td><td>22057045</td><td>0050375043</td><td>Конектор, 4-pin R/A</td><td>+5В основний постійний струм + GND, I2C@5V для живлення моніторів</td></tr><tr><td>J5</td><td>Високошвидкісне підключення плата-плата (B2B)</td><td>ADF6-30-03.5-L-4-2-A-TR</td><td>ADM6-30-01.5-L-4-2-A-TR</td><td>B2B Роз&#39;єм, 120-pin</td><td>Більше потужності 3.8V/3.3V/1.8V для встановлюваних плат, потужність 5V для режиму «SOM», розширення QUP, GPIO (включно з I2S), SDCC (SD Card V3.0), UFS1 (другорядна UFS Flash), 2L PCIe Gen 3, AMUX та сигнали SPMI PMIC</td></tr><tr><td>J6</td><td>Група камери 0</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B плагін, 60-пін</td><td>Qty-2 4L MIPI порти CSI, сигнали управління CCI і камери, 8 рейок живлення (від 1.05-V до 5V) для камер і інших сенсорів, виділених порту SPI (QUP)</td></tr><tr><td>J7</td><td>Група камери 1</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B плагін, 60-пін</td><td>Qty-2 4L MIPI порти CSI, сигнали управління CCI і камери, 8 рейок живлення (від 1.05-V до 5V) для камер і інших сенсорів, виділених порту SPI (QUP)</td></tr><tr><td>J8</td><td>Група камери 2</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B плагін, 60-пін</td><td>Qty-2 4L MIPI порти CSI, сигнали управління CCI і камери, 8 рейок живлення (від 1.05-V до 5V) для камер і інших сенсорів, виділених порту SPI (QUP)</td></tr><tr><td>J9</td><td>USB-C (ADB)</td><td>UJ31-CH-3-SMT-TR</td><td>USB Type-C</td><td>Кабель-з&#39;єднувач, 24-pin R/A</td><td>ADB USB-C з перезапуском та альтернативним режимом відображення порту (USB0)</td></tr><tr><td>J10</td><td>Розширення SPI</td><td>SM08B-GHS-TB(LF)(SN)</td><td>GHR-08V-S</td><td>Конектор, 8-pin R/A</td><td>SPI@3.3V з 2 CS_N пінами, 32kHz CLK_OUT@3.3V</td></tr><tr><td>J18</td><td>ESC (Доступ SLPI)</td><td>SM04B-GHS-TB(LF)(SN)</td><td>GHR-04V-S</td><td>Конектор, 4-pin R/A</td><td>ESC UART@3.3V, опорна напруга 3.3V</td></tr><tr><td>J19</td><td>GNSS/MAG/RC/I2C (доступ SLPI)</td><td>SM12B-GHS-TB(LF)(SN)</td><td>GHR-12V-S</td><td>Конектор, 6-pin R/A</td><td>GNSS UART@3.3V, Магнетометр I2C@3.3V, 5V, RC UART, Запасна I2C</td></tr></tbody></table><h3 id="посібник-користувача" tabindex="-1">Посібник користувача <a class="header-anchor" href="#посібник-користувача" aria-label="Permalink to &quot;Посібник користувача&quot;">​</a></h3><p>The PX4 user guide for VOXL 2 is available <a href="https://docs.modalai.com/voxl-px4/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="інструкція-розробника" tabindex="-1">Інструкція розробника <a class="header-anchor" href="#інструкція-розробника" aria-label="Permalink to &quot;Інструкція розробника&quot;">​</a></h3><p>The PX4 developer guide for VOXL 2 is available <a href="https://docs.modalai.com/voxl-px4-developer-guide/" target="_blank" rel="noreferrer">here</a>.</p><h3 id="як-зібрати" tabindex="-1">Як зібрати <a class="header-anchor" href="#як-зібрати" aria-label="Permalink to &quot;Як зібрати&quot;">​</a></h3><p>See the <a href="https://docs.modalai.com/voxl2-px4-build-guide/" target="_blank" rel="noreferrer">VOXL PX4 Build Guide</a> on how to build.</p><h2 id="підтримка" tabindex="-1">Підтримка <a class="header-anchor" href="#підтримка" aria-label="Permalink to &quot;Підтримка&quot;">​</a></h2><p>Please visit the <a href="https://forum.modalai.com/category/26/voxl-2" target="_blank" rel="noreferrer">ModalAI Forum</a> for more information.</p>',44)]))}const g=d(n,[["render",h]]);export{S as __pageData,g as default};
